import React, { Component } from 'react';
import nav_header from './nav/nav_header';
import nav_middle from './nav/nav_middle';

class App extends Component {
  render() {
    return (
      <div className='App'>
        <nav_header/>
        <nav_middle/>
      </div>
    );
  }
}

export default App;
